import React from "react";
//CSS
import "./ServicesCard.css";
//Components
import ServicesItem from "./servicesItem/ServicesItem";
//Assets
import one from "../../assets/pool.jpeg";


const ServicesCard = () => {
  return (
    <>
      <h1>Services</h1>
      <div className="wrapper">
        <ServicesItem icon={one} name="1" description="We deliver anywhere in the United States. We deliver anywhere in the United States. We deliver anywhere in the United States. We deliver anywhere in the United States." />
        <ServicesItem icon={one} name="2" description="We deliver anywhere in the United States" />
        <ServicesItem icon={one} name="3" description="We deliver anywhere in the United States" />
        <ServicesItem icon={one} name="4" description="We deliver anywhere in the United States" />
      </div>
    </>
  );
};

export default ServicesCard;
